import React from 'react';
import { BrowserRouter as Router, Route, Routes, NavLink } from 'react-router-dom';
import { Card } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import { motion } from 'framer-motion';

const MainPage = () => (
  <div className="text-center p-10">
    <h1 className="text-4xl font-bold mb-6">Welcome to My Personal Website</h1>
    <p className="text-lg">Explore my projects, tennis journey, and more about me.</p>
  </div>
);

const Projects = () => (
  <div className="p-6">
    <h2 className="text-2xl font-bold mb-4">Projects</h2>
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
      <Card className="p-4">Project 1</Card>
      <Card className="p-4">Project 2</Card>
      <Card className="p-4">Project 3</Card>
    </div>
  </div>
);

const Tennis = () => (
  <div className="p-6">
    <h2 className="text-2xl font-bold mb-4">Tennis Journey</h2>
    <p>Here, I will showcase videos of my tennis practice and games, along with related papers.</p>
  </div>
);

const About = () => (
  <div className="p-6">
    <h2 className="text-2xl font-bold mb-4">About Me</h2>
    <p>I am passionate about technology, tennis, and personal growth. This website serves as a space to share my journey.</p>
  </div>
);

const Menu = () => (
  <motion.nav
    initial={{ opacity: 0, y: -20 }}
    animate={{ opacity: 1, y: 0 }}
    className="bg-gray-800 text-white py-4 shadow-md">
    <ul className="flex justify-center space-x-6">
      <li>
        <NavLink to="/" className="hover:underline" end>
          Home
        </NavLink>
      </li>
      <li>
        <NavLink to="/projects" className="hover:underline">
          Projects
        </NavLink>
      </li>
      <li>
        <NavLink to="/tennis" className="hover:underline">
          Tennis
        </NavLink>
      </li>
      <li>
        <NavLink to="/about" className="hover:underline">
          About
        </NavLink>
      </li>
    </ul>
  </motion.nav>
);

const App = () => (
  <Router>
    <div className="font-sans">
      <Menu />
      <main className="container mx-auto mt-10">
        <Routes>
          <Route path="/" element={<MainPage />} />
          <Route path="/projects" element={<Projects />} />
          <Route path="/tennis" element={<Tennis />} />
          <Route path="/about" element={<About />} />
        </Routes>
      </main>
    </div>
  </Router>
);

export default App;
